from unittest import TestCase
from vcf_line_parser import VCFHeader, VCFLineSV

class TestVCFHeader(TestCase):
    def test_input(self):
        header=VCFHeader('#CHROM\tPOS\tID\tREF\tALT\tQUAL\tFILTER\tINFO\tFORMAT\tSample1')
        self.assertFalse(header.ERROR)
        self.assertEqual(1,len(header.SAMPLES))
        self.assertEqual("Sample1",header.SAMPLES[0])
    def test_invalid_input(self):
        header=VCFHeader('POS\tID\tREF\tALT\tQUAL\tFILTER\tINFO\tFORMAT')
        self.assertTrue(header.ERROR)
        self.assertEqual("",header.SAMPLES)

class TestVCFLineSV(TestCase):
    def test_input(self):
        line="13\t22253030\tHackIns1\tN\\t60\tPASS\tPRECISE;SVTYPE=INS;SVLEN=8848;END=22261878;AF=0.08\tGT:GQ\t0/0:60"
        vcf_line=VCFLineSV(line)
        self.assertFalse(vcf_line.ERROR)
        self.assertEqual("13",vcf_line.CHROM)
        self.assertEqual(22253030,vcf_line.POS)
        self.assertEqual('HackIns1',vcf_line.ID)
        self.assertEqual("",vcf_line.ALT)
        self.assertEqual('60',vcf_line.QUAL)
        self.assertEqual("PASS",vcf_line.FILTER)
        self.assertEqual("INS",vcf_line.SVTYPE)
        self.assertEqual
        #self.FILTER, INFO,
        #      FORMAT
    def test_invalid_input(self):
        line="13\t22253030\tHackIns1"
        vcf_line=VCFLineSV(line)
        self.assertTrue(vcf_line.ERROR)

